import React, { useState, useEffect } from "react";
import ImageList from "@mui/material/ImageList";
import ImageListItem from "@mui/material/ImageListItem";
import ImageListItemBar from "@mui/material/ImageListItemBar";
import "./Body.css";

import { Link } from "react-router-dom";

import Jeppe from "../../assets/Jeppe.jpg";
import Frede from "../../assets/Frede.jpg";
import Mangus from "../../assets/Mangus.jpg";
import Guffe from "../../assets/Guffe.jpg";
import Haas from "../../assets/Haas.jpg";
import Dumbass from "../../assets/Tomas.jpg";

function OmOsBody() {
  const [isMobile, setIsMobile] = useState(false);

  //choose the screen size
  const handleResize = () => {
    if (window.innerWidth < 720) {
      setIsMobile(true);
    } else {
      setIsMobile(false);
    }
  };

  // create an event listener
  useEffect(() => {
    window.addEventListener("resize", handleResize);
  });

  return (
    <div
      style={{
        backgroundColor: "rgba(0, 0, 0, 0.8)",
        borderRadius: "10px",
        maxWidth: "1200px",
        width: "90%",
        paddingBottom: 20,
        position: "relative",
        display: "flex",
        flexWrap: "wrap",
        overflow: "hidden",
        marginTop: 7,
        justifyContent: "center",
        border: "1px solid rgba(0, 0, 0, 0.2)",
      }}
      className="section"
    >
      <div className="textfield">
        <p>
          Med Roots in Suits på scenen, er du sikret en festlig aften med
          musikken i top! <br />
          Roots in Suits blev dannet på baggrund af et målrettet engagement og
          en ubændig trang til at optræde til festlige arrangementer, såsom
          bryllups-, jubilæums-, personale-, by-, og fødselsdagsfester. <br />
          Roots in Suits består af 6 unge fyre fra Ribe i alderen 22-26 år, der
          til sammen danner et dynamisk festband med mange års musikalsk
          erfaring. Med respekt for de gode gamle klassikere, formår de at
          levere et autentisk svar som en hyldest til de originale sangskrivere
          bag numrene.
          <br />
          Roots in Suits leverer musikken til DIN fest, og sørger løbende for at
          tilpasse aftenen til gæsternes behov. Kontakt os {""}
          <Link style={{ textDecoration: "none" }} to={"/booking"}>
            her
          </Link>
          {""} for at få et uforpligtende tilbud.
        </p>
      </div>
      {isMobile ? (
        <ImageList
          sx={{ width: "90%", height: "200vw" }}
          cols={2}
          rowHeight={"100%"}
          gap={7}
          className="gallery"
        >
          {itemData.map((item) => (
            <ImageListItem key={item.img}>
              <img
                src={`${item.img}?w=248&fit=crop&auto=format`}
                srcSet={`${item.img}?w=248&fit=crop&auto=format&dpr=2 2x`}
                alt={item.title}
                loading="lazy"
              />
              <ImageListItemBar title={item.title} subtitle={item.author} />
            </ImageListItem>
          ))}
        </ImageList>
      ) : (
        <ImageList
          sx={{ width: "90%", height: "80vw" }}
          cols={3}
          rowHeight={"100%"}
          gap={17}
          className="gallery"
        >
          {itemData.map((item) => (
            <ImageListItem key={item.img}>
              <img
                src={`${item.img}?w=248&fit=crop&auto=format`}
                srcSet={`${item.img}?w=248&fit=crop&auto=format&dpr=2 2x`}
                alt={item.title}
                loading="lazy"
              />
              <ImageListItemBar title={item.title} subtitle={item.author} />
            </ImageListItem>
          ))}
        </ImageList>
      )}
    </div>
  );
}

const itemData = [
  {
    img: Jeppe,
    title: "Jeppe Schimdt Hansen",
    author: (
      <a
        href="https://www.instagram.com/jeppe_schmidt/"
        className="link"
        target="_blank"
        rel="noopener noreferrer"
      >
        @jeppe_schmidt
      </a>
    ),
  },
  {
    img: Frede,
    title: "Frederik Wind",
    author: (
      <a
        href="https://www.instagram.com/frederik_wind/"
        className="link"
        target="_blank"
        rel="noopener noreferrer"
      >
        @frederik_wind
      </a>
    ),
  },
  {
    img: Mangus,
    title: "Magnus Mulbjerg Bendtsen",
    author: (
      <a
        href="https://www.instagram.com/magnus.mulbjerg/"
        className="link"
        target="_blank"
        rel="noopener noreferrer"
      >
        @magnus.mulbjerg
      </a>
    ),
  },
  {
    img: Guffe,
    title: "Gustav Thomsen Purreskov",
    author: (
      <a
        href="https://www.instagram.com/g_purreskov/"
        className="link"
        target="_blank"
        rel="noopener noreferrer"
      >
        @g_purreskov
      </a>
    ),
  },
  {
    img: Haas,
    title: "Jesper Haas Jensen",
    author: (
      <a
        href="https://www.instagram.com/jesperhaas/"
        className="link"
        target="_blank"
        rel="noopener noreferrer"
      >
        @jesperhaas
      </a>
    ),
  },
  {
    img: Dumbass,
    title: "Tomas O. Rosenvind Rieck",
    author: (
      <a
        href="https://www.instagram.com/riecktomas/"
        className="link"
        target="_blank"
        rel="noopener noreferrer"
      >
        @riecktomas
      </a>
    ),
  },
];

export default OmOsBody;
